import React , { Component } from 'react';
import { Doughnut } from 'react-chartjs-2';
import Divider from '@material-ui/core/Divider';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';

const styles = theme => ({
    root: {
      display: 'inline-flex',
      textAlign: 'center'
    }
  });

class NewUserData extends Component {
    constructor(props) {
        super(props);
        this.state = {
            ChartData: {
                labels: ['New User Growth', 'Conversion Rate'],
                datasets: [
                    {
                        label: 'Population',
                        data: [
                            6.43,
                            9.43
                        ],
                        backgroundColor: [
                            '#ce2e2e',
                            '#f11ac2ba'                            
                        ]
                    }
                ]
            }
        }
    }

    render() {
        const { classes } = this.props;
        return (
                <div>
                <Doughnut
                    data={this.state.ChartData}
                    options={{
                        maintainAspectRatio: false,
                        rotation: 1 * Math.PI,
                        circumference: 1 * Math.PI
                    }}
                />
                <Divider />
                <div className={classes.userRatio}>
                    <List className={classes.root}>
                        <ListItem>
                        <ListItemText primary="6.43%" secondary="New users Growth" />
                        </ListItem>
                        <li>
                        <Divider />
                        </li>
                        <ListItem>
                        <ListItemText primary="9.44%" secondary="Conversion Rate" />
                        </ListItem>
                    </List>
                </div>
            </div>
        )
    }
} 
NewUserData.propTypes = {
    classes: PropTypes.object.isRequired,
  };
  
export default withStyles(styles)(NewUserData);
